import React, {Component} from 'react';
import './Search.css';

export default class Search extends Component {
    render() {
      return(
            <form className="Search" action="" method="post">
                <input className="Search-text" type="text"></input>
                <div className="Search-logo">logo</div>
            </form>
      )
    }
  }
